SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "public"."regioni" (gid serial PRIMARY KEY,
"cod_reg" int4,
"nome_reg" varchar(50));
SELECT AddGeometryColumn('public','regioni','the_geom','4326','MULTIPOLYGON',2);
CREATE INDEX "regioni_the_geom_gist" ON "public"."regioni" using gist ("the_geom" gist_geometry_ops);
END;
